CREATE TABLE movies(
   director_name          VARCHAR(32) NOT NULL
  ,duration               INTEGER 
  ,actor1_name            VARCHAR(28)
  ,gross                  INTEGER 
  ,genres                 VARCHAR(64) NOT NULL
  ,actor2_name            VARCHAR(27)
  ,movie_title            VARCHAR(87) NOT NULL PRIMARY KEY
  ,num_voted_users        VARCHAR(19) NOT NULL
  ,actor3_name            VARCHAR(29)
  ,facenumber_in_poster   VARCHAR(10)
  ,plot_keywords          VARCHAR(149)
  ,movie_imdb_link        VARCHAR(52) NOT NULL
  ,num_user_for_reviews   VARCHAR(52)
  ,language               VARCHAR(10)
  ,country                VARCHAR(20)
  ,content_rating         VARCHAR(9)
  ,budget                 INTEGER 
  ,title_year             INTEGER 
  ,actor_2_facebook_likes INTEGER 
  ,imdb_score             NUMERIC(3,1) NOT NULL
  ,aspect_ratio           NUMERIC(4,2)
  ,movie_facebook_likes   INTEGER  NOT NULL
);
